l-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span>             <span class="html-tag">&lt;/div&gt;</span>    </td></tr><tr><td class="line-number" value="27"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="28"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="29"></td><td class="line-content">                        </td></tr><tr><td class="line-number" value="30"></td><td class="line-content">                <span class="html-tag">&lt;div <span class="html-attribute-name">class</span>="<span class="html-attribute-value">breed-rt</span>"&gt;</span></td></tr><tr><td class="line-number" value="31"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="32"></td><td class="line-content">                <span class="html-tag">&lt;td&gt;</span><span class="html-tag">&lt;img</span></td></tr><tr><td class="line-number" value="33"></td><td class="line-content">        <span class="html-attribute-name">src</span>="<a class="html-attribute-value html-resource-link" target="_blank" href="http://localhost/doggy2/doggy/almankurdu.jpg" rel="noreferrer noopener">almankurdu.jpg</a>" <span class="html-attribute-name">width</span>="<span class="html-attribute-value">150px</span>"</td></tr><tr><td class="line-number" value="34"></td><td class="line-content">        <span class="html-attribute-name">height</span>="<span class="html-attribute-value">150px</span>"/&gt;<span class="html-tag">&lt;/td&gt;</span>      Generally considered dogkind's finest all-purpose worker, the German Shepherd Dog is a large, agile, muscular dog of noble character and high intelligence. Loyal, confident, courageous, and steady, the German Shepherd is truly a dog lover's delight. <span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span>             <span class="html-tag">&lt;/div&gt;</span>    </td></tr><tr><td class="line-number" value="35"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="36"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="37"></td><td class="line-content">                        </td></tr><tr><td class="line-number" value="38"></td><td class="line-content">                <span class="html-tag">&lt;div <span class="html-attribute-name">class</span>="<span class="html-attribute-value">breed-rt</span>"&gt;</span></td></tr><tr><td class="line-number" value="39"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="40"></td><td class="line-content">                <span class="html-tag">&lt;td&gt;</span><span class="html-tag">&lt;img</span></td></tr><tr><td class="line-number" value="41"></td><td class="line-content">        <span class="html-attribute-name">src</span>="<a class="html-attribute-value html-resource-link" target="_blank" href="http://localhost/doggy2/doggy/akita.jpg" rel="noreferrer noopener">akita.jpg</a>" <span class="html-attribute-name">width</span>="<span class="html-attribute-value">150px</span>"</td></tr><tr><td class="line-number" value="42"></td><td class="line-content">        <span class="html-attribute-name">height</span>="<span class="html-attribute-value">150px</span>"/&gt;<span class="html-tag">&lt;/td&gt;</span>      The Akita is a muscular, double-coated dog of ancient Japanese lineage famous for their dignity, courage, and loyalty. In their native land, they're venerated as family protectors and symbols of good health, happiness, and long life.</td></tr><tr><td class="line-number" value="43"></td><td class="line-content"></td></tr><tr><td class="line-number" value="44"></td><td class="line-content">Akitas are burly, heavy-boned spitz-type dogs of imposing stature. Standing 24 to 28 inches at the shoulder, Akitas have a dense coat that comes in several colors, including white. The head is broad and massive, and is balanced in the rear by a full, curled-over tail. The erect ears and dark, shining eyes contribute to an expression of alertness, a hallmark of the breed. Akitas are quiet, fastidious dogs. Wary of strangers and often intolerant of other animals, Akitas will gladly share their silly, affectionate side with family and friends. They thrive on human companionship. The large, independent-thinking Akita is hardwired for protecting those they love. They must be well socialized from birth with people and other dogs.<span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span>             <span class="html-tag">&lt;/div&gt;</span>    </td></tr><tr><td class="line-number" value="45"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="46"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="47"></td><td class="line-content">                        </td></tr><tr><td class="line-number" value="48"></td><td class="line-content">                <span class="html-tag">&lt;div <span class="html-attribute-name">class</span>="<span class="html-attribute-value">breed-rt</span>"&gt;</span></td></tr><tr><td class="line-number" value="49"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="50"></td><td class="line-content">                <span class="html-tag">&lt;td&gt;</span><span class="html-tag">&lt;img</span></td></tr><tr><td class="line-number" value="51"></td><td class="line-content">        <span class="html-attribute-name">src</span>="<a class="html-attribute-value html-resource-link" target="_blank" href="http://localhost/doggy2/doggy/abuldog.jpg" rel="noreferrer noopener">abuldog.jpg</a>" <span class="html-attribute-name">width</span>="<span class="html-attribute-value">150px</span>"</td></tr><tr><td class="line-number" value="52"></td><td class="line-content">        <span class="html-attribute-name">height</span>="<span class="html-attribute-value">150px</span>"/&gt;<span class="html-tag">&lt;/td&gt;</span>      American Bulldogs are a well-balanced athletic dog that demonstrate great strength, endurance, agility, and a friendly attitude. Historically, they were bred to be a utility dog used for working the farm.</td></tr><tr><td class="line-number" value="53"></td><td class="line-content"></td></tr><tr><td class="line-number" value="54"></td><td class="line-content">The American Bulldog is a descendant of the English Bulldog. It is believed that the bulldog was in America as early as the 17th century. They came to the United States in the 1800s, with immigrants who brought their working bulldogs with them. Small farmers and ranchers used this all-around working dog for many tasks including farm guardians, stock dogs, and catch dogs. The breed largely survived, particularly in the southern states, due to its ability to bring down and catch feral pigs.<span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span><span class="html-tag">&lt;br&gt;</span>             <span class="html-tag">&lt;/div&gt;</span>    </td></tr><tr><td class="line-number" value="55"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="56"></td><td class="line-content">                </td></tr><tr><td class="line-number" value="57"></td><td class="line-content">            <span class="html-tag">&lt;/div&gt;</span></td></tr><tr><td class="line-number" value="58"></td><td class="line-content">   </td></tr><tr><td class="line-number" value="59"></td><td class="line-content">    <span class="html-tag">&lt;/div&gt;</span></td></tr><tr><td class="line-number" value="60"></td><td class="line-content">    <span class="html-tag">&lt;/div&gt;</span></td></tr><tr><td class="line-number" value="61"></td><td class="line-content"></td></tr><tr><td class="line-number" v